      "consulteeComments": [
        {
          "comment": "The original factory building at 5-6 Underhill Street was partially destroyed by enemy action during WWII and rebuilt in 1946. The site is located within Camden Town Conservation Area.\r\n\r\nIn 1988 consent was granted for external alterations to the building (plus small extension). This is the building we find today.\r\n\r\nUnderhill Street faade (ref 8701306)\r\n\r\nThe current proposal seeks to return the Underhill Street elevation to an arrangement of four windows at ground floor level as previously granted in 1988.\r\n\r\nTo ensure the building retains an architecturally coherent appearance there should be a condition attached to any consent requiring the new windows to match the existing windows in style i.e. have an Art Deco metal Crittall-like appearance.\r\n\r\nProviding the design of the proposed windows is in keeping, the elevational changes are considered not to harm the contribution made by this building to the character and appearance of the streetscape and hence the conservation area.\r\n",
          "receivedAt": "2025-07-03T15:55:27.525+01:00"
        },
        {
          "comment": "Secure cycle parking via condition and car-free via s106. ",
          "receivedAt": "2025-07-03T15:56:58.839+01:00"
        }
      ]
    },
    "pressNotice": {
      "required": true,
      "reason": "Conservation area",
      "publishedAt": "2025-07-03T00:00:00.000+01:00"
    }
  },
